import React, { useEffect, useState } from 'react';
import HomeIcon from '@material-ui/icons/Home';
import SubscriptionsIcon from '@material-ui/icons/Subscriptions';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import SidebarRow from './SidebarRow/SidebarRow';
import HistoryIcon from '@material-ui/icons/History';
import OndemandVideoIcon from '@material-ui/icons/OndemandVideo';
import ExploreIcon from '@material-ui/icons/Explore';
import WatchLaterIcon from '@material-ui/icons/WatchLater';
import ThumbUpAltOutlinedIcon from '@material-ui/icons/ThumbUpAltOutlined';
import ExpandMoreOutlinedIcon from '@material-ui/icons/ExpandMoreOutlined';
import "./Sidebar.css";
function Sidebar() {
    const [selectedItem, setSelectedItem] = useState('Home')

    // useEffect(() => {
    //     console.log(selectedItem)
    // }, [selectedItem])
    return (
        <div className="sidebar" onChange={e => console.log(e.target)}>
            <span><SidebarRow value="Home" selected={true} Icon={HomeIcon} title="Home" /></span>
            <SidebarRow value="Explore" Icon={ExploreIcon} title="Explore" />
            <SidebarRow onClick={e => setSelectedItem('Subscription')} Icon={SubscriptionsIcon} title="Subscription" />
            <hr />
            <SidebarRow onClick={e => setSelectedItem('Library')} Icon={VideoLibraryIcon} title="Library" />
            <SidebarRow onClick={e => setSelectedItem('History')} Icon={HistoryIcon} title="History" />
            <SidebarRow onClick={e => setSelectedItem('Your videos')} Icon={OndemandVideoIcon} title="Your videos" />
            <SidebarRow onClick={e => setSelectedItem('Watch Later')} Icon={WatchLaterIcon} title="Watch Later" />
            <SidebarRow onClick={e => setSelectedItem('Liked videos')} Icon={ThumbUpAltOutlinedIcon} title="Liked videos" />
            <SidebarRow onClick={e => setSelectedItem('Show more')} Icon={ExpandMoreOutlinedIcon} title="Show more" />
            <hr />
        </div>
    )
}

export default Sidebar
